def shrinkageOperator(shrinkV,shrinkLambda,shrinkRho):
    '''defining the shrinkage operator'''
    if shrinkV>=shrinkLambda*shrinkRho:
        shrinkValue=shrinkV-(shrinkLambda*shrinkRho)
    elif shrinkV==shrinkLambda*shrinkRho:
        shrinkValue=0
    elif shrinkV<=shrinkLambda*shrinkRho:
        shrinkValue=shrinkV+(shrinkLambda*shrinkRho)
    return shrinkValue

